if(!HTMLCollection.prototype.addEventListener){HTMLCollection.prototype.addEventListener=function(c,b){var a;for(a=0;a<this.length;a+=1){this[a].addEventListener(c,b,false)}return this}}if(!HTMLCollection.prototype.addEventListeners){HTMLCollection.prototype.addEventListeners=function(c,b){var a;for(a=0;a<this.length;a+=1){this[a].addEventListeners(c,b,false)}return this}};